import React from 'react';
import './App.css';
import Header from './Components/Header/Header';
import Home from './Components/Home/Home';

import store from './store';
import { Provider } from 'react-redux';
function App() {
  fetch("https://microsoft-azure-bing-news-search-v1.p.rapidapi.com/search?q=germany", {
    "method": "GET",
    "headers": {
      "x-rapidapi-host": "microsoft-azure-bing-news-search-v1.p.rapidapi.com",
      "x-rapidapi-key": "b6d1390605mshdf8aa24f282ddc6p13087bjsnb4b835881a2d"
    }
  })
  .then(response => {
    console.log(response);
  })
  .catch(err => {
    console.log(err);
  });
  return (
    <Provider store={store}>
      <div className="App">
        <Header/>
        <Home></Home>
      </div>
    </Provider>
  );
}

export default App;
